import React from "react";
import { useState } from 'react';

const Body = () => {

    
  const[precios, agregarPrecio] = useState(
        [
        {id:1, nombre: "1/4", precio: 1000 },
        {},
        ]
    );
    return (
        precios.map(precio => (
            <p> {precio.nombre} | {precio.precio}</p>
        ))
    );
}

export default Body
